    false,nt"url": null,nt"notes": "This wildlife inventory plan for Reelfoot
    and Lake Isom National Wildlife Refuges includes survey procedure forms that represent
    cost effective inventory of the wildlife populations on the two Refuges. The species
    selected for inventory were based onguidance provided in the Refuge Manual and the
    Regional Office memo of April 10, 1985"Wildlife Inventory Plans". Most inventory
    procedures are integrated with other refuge wildlifemanagement activities and studies
    to provide either an objective evaluation of that activity oradditional management
    information concerning that activity. This plan represents the full scaleof inventory
    needs at these two sites.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
